   "source": [
    "#Optional Section\n",
    "set.seed(1)\n",
    "ctrl <- trainControl(method=\"repeatedcv\",number=10,repeats = 3)\n",
    "mean_imp_model <- train(x=breastcancer1[,1:10],y=breastcancer1[,11], method = \"knn\", trControl = ctrl, \n",
    "                preProcess = c(\"center\",\"scale\"), tuneLength = 10)\n",
    "\n",
    "plot(mean_imp_model,col = \"dark blue\",lwd=5,lty=2,cex.lab=1.25,cex.main=1.5,\n",
    "     main=\"Mode Imputation Accuracy of kNN\",\n",
    "     xlab=\"Number of Neighbors\",\n",
    "     ylab=\"Classification Accuracy\")\n",
    "\n",
    "mean_imp_model"
   ]
