    "set.seed(6)\n",
    "removed_na <- na.omit(breastcancer)\n",
    "summary(removed_na)\n",
    "\n",
    "no_na_imp_model <- train(x=removed_na[,1:10],y=removed_na[,11], method = \"knn\", trControl = ctrl, \n",
