    "\n",
    "plot(no_na_imp_model,col = \"dark blue\",lwd=5,lty=2,cex.lab=1.25,cex.main=1.5,\n",
    "     main=\"Less Missing Values Accuracy of kNN\",\n",
    "     xlab=\"Number of Neighbors\",\n",
    "     ylab=\"Classification Accuracy\")"
   ]
