   "source": [
    "#Introducing binary variable to indicate missing values\n",
    "breastcancer1$Missing_Variable <- as.integer(complete.cases(breastcancer$Bare_Nuclei))\n",
    "\n",
    "summary(breastcancer1)\n",
    "\n",
    "set.seed(8)\n",
    "\n",
    "bin_imp_model <- train(x=breastcancer1[,c(1:10,12)],y=breastcancer1[,11], method = \"knn\", trControl = ctrl, tuneLength = 10)\n",
    "\n",
    "plot(bin_imp_model,col = \"dark blue\",lwd=5,lty=2,cex.lab=1.25,cex.main=1.5,\n",
    "     main=\"Mean Imputation with Binary Missing Value Column Accuracy of kNN\",\n",
    "     xlab=\"Number of Neighbors\",\n",
    "     ylab=\"Classification Accuracy\")"
   ]
  },
