   "source": [
    "We can see that the KNN models using the mean, mode, regression, and regression with perturbation datasets all return rather accurate classifications! While the number of k neighbors per dataset varied with the mean imputation using , the accuracies all arrived to ~96.9% which is statistically significant (p = 0.031)! However, I wanted to note that when I attempted to add in a binary column indicating which rows contained missing data that the accuracy of my KNN model including this new variable decreased to <68%. Further investigation could find that it's perhaps a valuable addition to the model if we remove some of the other variables."
   ]
