    "tags": []
   },
   "source": [
    "In the supply chain industry I work in, the optimization could be used to determine the best way to store inventory in our warehouses and ship it to our retail stores to minimize overall cost while also meeting our store demands and warehouse capacity limitations. To name a few of the factors that we would need in order to determine what inventory should be stored in which warehouses and what stores that warehouse shoouuld service include number of warehouses/stores, current locations of each (to determine distance), warehouse storage capabilities (dry, cold, frozen, a combo?), warehouse capacity, warehouse production (enough labor to keep up with demand/ability to hire additional if needed, selection accuracy), and many more. Currently, we are working on a project of this nature to determine how much inventory we need to order for the holidays in order to meet store/customer demand."
   ]
